import React, {Component} from 'react';
import './App.css';

class Footer extends Component {  

  render() {

    return (
      <div className="Footer">
        <Socials />
        <Address />
      </div>

    )
  }

}

export default Footer;

const Socials = () => {
  return (
    <div className="Socials">
      <div className="social-container">
        <h2>Social</h2>
      </div>
    </div>
  )
}
